import React, { useState } from 'react';

export default function RegistrationPage() {

  // new Date() creates a Date object for the current date/time.
  // 2. toISOString() converts it to an ISO string: "2025-12-10T14:32:18.123Z".
  // 3. split("T") separates the date and time into ["2025-12-10", "14:32:18.123Z"].
  // 4. [0] selects only the date part ("2025-12-10").
  const today = new Date().toISOString().split('T')[0];

  const [formData, setformData] = useState({
    participantName: '',
    orgName: '',
    designation: '',
    emailID: '',
    phoneNumber: '',
    eventName: '',
    eventID: '',
    eventDate: '',
    eventOrganizer: ''
  });

  function handleSubmit(event){
    //Page will be reloaded and the input data will be lost
    event.preventDefault();
  }

  function handleChange(event){
    setformData({
      ...formData,
      [event.target.id]: event.target.value
    });
  }

  return (
    <div>
      <form onSubmit = {handleSubmit}>
        <label> Name of the Participant: </label>
        <input type = 'text' id = 'participantName'  placeholder = 'Participant Name' value = {formData.participantName} onChange = {handleChange}/> <br/><br/>
        
        <label for = 'orgName'> Name of the Organization: </label>
        <input type = 'textbox' id = 'orgName' placeholder = 'Organization' value = {formData.orgName}/> <br/><br/>
        
        <label for = 'designation'> Designation of the Participant: </label>
        <input type = 'textbox' id = 'designation' placeholder = 'Designation' value = {formData.designation}/> <br/><br/>
        
        <label for = 'emailID'> Email Address of the Participant: </label>
        <input type = 'email' id = 'emailID' placeholder = 'youremail@abc.com' value = {formData.emailID}/> <br/><br/>
        
        <label for = 'phoneNumber'> Phone Number of the Participant: </label>
        <input type = 'textbox' id = 'phoneNumber' placeholder = '1234567890' value = {formData.phoneNumber}/> <br/><br/>
        
        <label for = 'eventName'> Name of the Event: </label>
        <input type = 'textbox' id = 'eventName' placeholder = 'Co-Pilot Seminar,Database Seminar,....' value = {formData.eventName}/> <br/><br/>
        
        <label for = 'eventID'> ID of the Event: </label>
        <input type = 'textbox' id = 'eventID' placeholder = 'AB123CD4' value = {formData.eventID}/> <br/><br/>
        
        <label for = 'eventDate'> Date of the Event: </label>
        <input type = 'date' min = {today} id = 'eventDate' /> <br/><br/>
        
        <label for = 'eventOrganizer'> Name of the Event Organiser: </label>
        <input type = 'textbox' id = 'eventOrganizer' placeholder = 'Microsoft, Oracle,....' value = {formData.eventOrganizer}/> <br/><br/>

       <button type = 'submit' id = 'submitButton'> Submit </button>
      
      </form>
    </div>
  )
}
